WireGuard is an extremely simple yet fast and modern VPN&lt;br /&gt;
                                that utilizes state-of-the-art cryptography. It aims to be&lt;br /&gt;
                                faster, simpler, leaner, and more useful than IPSec, while&lt;br /&gt;
                                avoiding the massive headache. It intends to be considerably&lt;br /&gt;more performant than OpenVPN. WireGuard is designed as a&lt;br /&gt;
                                general purpose VPN for running on embedded interfaces and&lt;br /&gt;
                                super computers alike, fit for many different circumstances.&lt;br /&gt;
                                Initially released for the Linux kernel, it is now&lt;br /&gt;
                                cross-platform and widely deployable. It is currently under&lt;br /&gt;
                                heavy development, but already it might be regarded as the&lt;br /&gt;
                                most secure, easiest to use, and simplest VPN solution in&lt;br /&gt;
                                the industry.

The Reliable, High Performance TCP/HTTP(S) Load Balancer.&lt;br /&gt;
                        This package implements the TCP, HTTP and HTTPS balancing features from haproxy.&lt;br /&gt;
                        Supports ACLs for smart backend switching.

Nmap is a utility for network exploration or security auditing.&lt;br/&gt;
                        It supports ping scanning (determine which hosts are up), many port scanning techniques (determine what services the hosts are offering), version detection (determine what application/service is running on a port), and TCP/IP fingerprinting (remote host OS or device identification).
                        It also offers flexible target and port specification, decoy/stealth scanning, SunRPC scanning, and more.
